def write_arr_from_txt(fname, txt):
	arr = np.array([float(s) for s in txt.split()], 'float32')
	f = open(fname, 'wb')
	arr.tofile(f)
	print("Wrote %d bytes to %s ..." % (f.tell(), fname))
	f.close()
